import React,{Component} from 'react';
import { Form , Input  } from 'semantic-ui-react';

class ContributeForm extends Component{

    render(){
        return (
            <Form>
              <Form.Field>
                <label>总的投资额度</label>
                <Input label="ether" labelPosition="right" />
              </Form.Field>
            </Form>
            
         );
    }
}
export default ContributeForm;
